import React, { useState } from 'react';

const RegistrationForm = () => {
  const [formData, setFormData] = useState({
    fullName: '',
    nickName: '',
    dob: '',
    gender: '',
    address: '',
    telephone: '',
    email: '',
    password: '',
    confirmPassword: '',
  });

  const [otpData, setOtpData] = useState({
    email: '',
    otp: '',
  });

  const [showOtpPage, setShowOtpPage] = useState(false);
  const [otpSent, setOtpSent] = useState(false);
  const [errorMessage, setErrorMessage] = useState('');

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleOtpChange = (e) => {
    setOtpData({ ...otpData, [e.target.name]: e.target.value });
  };

  const handleTelephoneChange = (e) => {
    const inputValue = e.target.value;
    if (/^\d{10}$/.test(inputValue) || inputValue === '') {
      setFormData({ ...formData, telephone: inputValue });
    }
  };

  const handleDobChange = (e) => {
    setFormData({ ...formData, dob: e.target.value });
  };

  const handleEmailValidation = () => {
    // You may use a library like 'validator' for email validation
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Validate form data here

    try {
      const response = await fetch('YOUR_BACKEND_API_URL/api/v1/otp/sendOTP', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ email: formData.email }),
      });

      if (response.ok) {
        setOtpSent(true);
        setShowOtpPage(true);
      } else {
        const errorData = await response.json();
        setErrorMessage(errorData.message);
      }
    } catch (error) {
      console.error('Error sending OTP:', error);
    }
  };

  const handleOtpVerification = async (e) => {
    e.preventDefault();

    // Validate OTP data here

    try {
      const response = await fetch('YOUR_BACKEND_API_URL/api/v1/otp/verifyOTP', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(otpData),
      });

      if (response.ok) {
        console.log('Registration successful!');
      } else {
        const errorData = await response.json();
        setErrorMessage(errorData.message);
      }
    } catch (error) {
      console.error('Error verifying OTP:', error);
    }
  };

  return (
    <div>
      <form onSubmit={showOtpPage ? handleOtpVerification : handleSubmit}>
        <div>
          <label>Full Name:</label>
          <input
            type="text"
            name="fullName"
            value={formData.fullName}
            onChange={handleChange}
          />
        </div>

        <div>
          <label>Nick Name:</label>
          <input
            type="text"
            name="nickName"
            value={formData.nickName}
            onChange={handleChange}
          />
        </div>

        <div>
          <label>Date of Birth (YYYY-MM-DD):</label>
          <input
            type="text"
            name="dob"
            value={formData.dob}
            onChange={handleDobChange}
          />
        </div>

        {/* Add other form fields here */}

        <div>
          <label>Email:</label>
          <input
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            onBlur={handleEmailValidation}
          />
        </div>

        {showOtpPage && (
          <div>
            <label>Enter OTP sent to your email:</label>
            <input
              type="text"
              name="otp"
              value={otpData.otp}
              onChange={handleOtpChange}
            />
          </div>
        )}

        <button type="submit">{showOtpPage ? 'Verify OTP' : 'Submit'}</button>
      </form>

      {errorMessage && <div style={{ color: 'red' }}>{errorMessage}</div>}
    </div>
  );
};

export default RegistrationForm;
